import React from "react";

const SelectionCard = (props) => {
  return (
    <div className="selection">
        <h1>{props.header}</h1>
        <p>With this program, you&#39;ll learn what it takes and everything you need to work.</p>
        <ul className="listCheck">
            <li> <img src={`../icons/checkbox.svg`} alt="check"/>Strategy </li>
            <li> <img src={`../icons/checkbox.svg`} alt="check"/>Planning</li>
            <li> <img src={`../icons/checkbox.svg`} alt="check"/>Pitching &amp; Winning Clients</li>
        </ul>
        <div className="selectionButton">
            <button>Learn More</button>
            <img src={`../icons/arrowright.svg`} alt="arror right"/>
        </div>
    </div>
  );
};

export default SelectionCard;
